    width: 60%;
`;

const Right = styled.div`
    width: 40%;
`;

const Title = styled.p`
    font-size: 54px;  
    margin-top: 60px;
    text-align: center;
`;

const Text = styled.p`
    font-size: 20px;
    padding: 10px 0;
`;
    
const List = styled.ul`
