`;

const ListItem = styled.li`
    padding: 30px 30px 30px 10px;
    font-size: 24px;
`;


const Price = () => {
  return (
      <>
    <Title>Price list</Title>
    <Container>
        <Left>
        <List>
            <ListItem>Cakes<Text>It all depends on weight and design. Price for 1 kilo is <b>200 hrn</b>. Also it depends on type of cream, type of fruits used in cake and so on. Final price we always tell in the end of discussion.</Text></ListItem>
            <ListItem>Cupcakes<Text>It all depends on weight and design. Price for 1 kilo is <b>200 hrn</b>. Also it depends on type of cream, type of fruits used in cake and so on. Final price we always tell in the end of discussion.</Text></ListItem>
            <ListItem>Pastries<Text>It all depends on weight and design. Price for 1 kilo is <b>200 hrn</b>. Also it depends on type of cream, type of fruits used in cake and so on. Final price we always tell in the end of discussion.</Text></ListItem>
        </List>
        </Left>
        <Right>

        </Right>
    </Container>
    </>
  )
}

export default Price
